// src/components/BoardScene.jsx
import React from "react";
import { OrbitControls } from "@react-three/drei";
import * as THREE from "three";
import Bike from "./Bike";

// Radios de los anillos del tablero
const RADII = [4.0, 2.9, 1.8];
const MAX_SLOTS = 6;

const RING_COLORS = {
  expectativas: "#ffd84d",
  contribucion: "#3e80ff",
  desafios: "#ff4d4d"
};

const ROUND_KEY = ["expectativas", "contribucion", "desafios"];

// Posición objetivo del jugador
function getTargetPosition(ringIndex, slotIndex) {
  const radius = RADII[ringIndex];
  const angle = (Math.PI * 2 * slotIndex) / MAX_SLOTS + Math.PI / 2;

  return new THREE.Vector3(
    Math.cos(angle) * radius,
    0.4,
    Math.sin(angle) * radius
  );
}

export default function BoardScene({
  players,
  currentRound,
  currentPlayerId
}) {
  const roundKey = ROUND_KEY[currentRound];

  return (
    <>
      {/* Fondo */}
      <color attach="background" args={["#2f2f36"]} />

      {/* LUCES */}
      <ambientLight intensity={0.7} />
      <directionalLight
        castShadow
        intensity={1.1}
        position={[6, 10, 5]}
      />

      {/* TABLERO — Base */}
      <mesh receiveShadow rotation-x={-Math.PI / 4.5} rotation-y={Math.PI / 4}>
        <cylinderGeometry args={[4.8, 4.8, 0.4, 60]} />
        <meshStandardMaterial color="#2c2c33" />
      </mesh>

      {/* ANILLO EXTERNO */}
      <mesh receiveShadow rotation-x={-Math.PI / 4.5} rotation-y={Math.PI / 4}>
        <ringGeometry args={[3.5, 4.7, 64]} />
        <meshStandardMaterial
          color={RING_COLORS.expectativas}
          emissive={
            roundKey === "expectativas"
              ? RING_COLORS.expectativas
              : "#000000"
          }
          emissiveIntensity={roundKey === "expectativas" ? 0.45 : 0}
        />
      </mesh>

      {/* ANILLO MEDIO */}
      <mesh receiveShadow rotation-x={-Math.PI / 4.5} rotation-y={Math.PI / 4}>
        <ringGeometry args={[2.4, 3.4, 64]} />
        <meshStandardMaterial
          color={RING_COLORS.contribucion}
          emissive={
            roundKey === "contribucion"
              ? RING_COLORS.contribucion
              : "#000000"
          }
          emissiveIntensity={roundKey === "contribucion" ? 0.45 : 0}
        />
      </mesh>

      {/* ANILLO INTERNO */}
      <mesh receiveShadow rotation-x={-Math.PI / 4.5} rotation-y={Math.PI / 4}>
        <ringGeometry args={[1.3, 2.0, 64]} />
        <meshStandardMaterial
          color={RING_COLORS.desafios}
          emissive={
            roundKey === "desafios" ? RING_COLORS.desafios : "#000000"
          }
          emissiveIntensity={roundKey === "desafios" ? 0.45 : 0}
        />
      </mesh>

      {/* CENTRO */}
      <mesh
        castShadow
        receiveShadow
        rotation-x={-Math.PI / 4.5}
        rotation-y={Math.PI / 4}
      >
        <cylinderGeometry args={[1, 1, 0.5, 48]} />
        <meshStandardMaterial color="#ffffff" />
      </mesh>

      {/* BICICLETAS */}
      {players.map((p, i) => {
        if (p.maxRoundReached < 0) return null;

        const ringIndex = Math.min(p.maxRoundReached, 2);
        const slotIndex = i;

        return (
          <Bike
            key={p.id}
            color={p.color}
            target={getTargetPosition(ringIndex, slotIndex)}
            isActive={p.id === currentPlayerId}
          />
        );
      })}

      {/* CONTROLES DE CÁMARA */}
      <OrbitControls
        enablePan={false}
        minDistance={6}
        maxDistance={9}
        maxPolarAngle={Math.PI / 2}
      />
    </>
  );
}
